import React from 'react';


const ProfileCard = () => {
    return (<>
    <img
                      src={student.profile_img || "https://cdn.pixabay.com/photo/2015/10/05/22/37/blank-profile-picture-973460_960_720.png"}
                      alt="Admin"
                      className="rounded-circle"
                      width="150"
                    />
    </>);
}


export default ProfileCard;
